import React from "react";
import { Link, useParams } from "react-router-dom";
import Flag from "react-world-flags";
import AddTechnicalDetails from "components/aidchannel/webmaster/AddTechnicalDetails";

const TechnicalDetails = () => {
  const { codeCountry, idProject } = useParams();
  return (
    <div className="container">
      <>
        <h1>
          <Flag
            code={codeCountry}
            height="70"
            width="70"
            style={{ marginRight: "2px" }}
            className="flag"
          />
          Technical Details
        </h1>
        <hr />
        <Link
          to={`/web-master/edit-technical-details/${codeCountry}/${idProject}`}
        >
          <button className="btn btn-warning m-3">Edit technical details</button>
        </Link>
        <AddTechnicalDetails />
      </>
    </div>
  );
};

export default TechnicalDetails;
